fn test_is_zero() {
    let a = SafeU120::min();
    assert(a.value == 0);
    assert(a.is_zero() == true);
}

#[test]
fn test_eq() {
    let a = SafeU120::new(1);
    let b = SafeU120::new(1);
    assert(a.eq(b));
}

#[test]
fn test_lt() {
    let a = SafeU120::new(1);
    let b = SafeU120::new(2);
    assert(a.lt(b));
    assert(b.lt(a) == false);
}


#[test]
fn test_le() {
    let a = SafeU120::new(2);
    let b = SafeU120::new(2);
    let c = SafeU120::new(5);
    assert(a.le(b));
    assert(a.le(c));
    assert(c.le(a) == false);
}

#[test]
fn test_gt() {
    let a = SafeU120::new(1);
    let b = SafeU120::new(2);
    assert(b.gt(a));
    assert(a.gt(b) == false);
}


#[test]
fn test_ge() {
    let a = SafeU120::new(2);
    let b = SafeU120::new(2);
    let c = SafeU120::new(5);
    assert(a.ge(b));
    assert(a.ge(c) == false);
    assert(c.ge(a));
}

#[test(should_fail)]
