    let a = SafeU120::new(2);
    let b = SafeU120::new(1);
    let c = SafeU120::sub(a, b);
    assert(c.value == 1);
}

#[test(should_fail)]
fn test_sub_underflow() {
    let a = SafeU120::new(1);
    let b = SafeU120::new(2);
    let _c = SafeU120::sub(a, b);
}

#[test]
fn test_mul() {
    let a = SafeU120::new(2);
    let b = SafeU120::new(3);
    let c = SafeU120::mul(a, b);
    assert(c.value == 6);
