    let b = SafeU120::new(2);
    let _c = SafeU120::mul(a, b);
}

#[test]
fn test_div() {
    let a = SafeU120::new(6);
    let b = SafeU120::new(3);
    let c = SafeU120::div(a, b);
    assert(c.value == 2);
}

